import React, { Component } from 'react';
import './App.css';
import callAPI from './modules/FetchAPI'

class App extends Component {
  render() {
    let data
    let students = callAPI().then(res=>data=res)
    return (
      <div className="page">
      {/* {students && students.map(stu=>
        <div>
          {stu}
        </div>
      )} */}
      </div>
    );
  }
}

export default App;
